import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import Login from './components/Login';
import TopUp from './components/TopUp';
import ProtectedRoute from './components/ProtectedRoute';
import UserInfo from './components/UserInfo';
import EditPassword from './components/EditPassword';
import DeleteUser from './components/DeleteUser';
import EditTransaction from './components/EditTransaction';
import DeleteTransaction from './components/DeleteTransaction';
import TransactionHistory from './components/TransactionHistory';
import Register from './components/Register';  // Import the Register component

function App() {
  return (
    <AuthProvider>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />  // Add the Register route
          <ProtectedRoute path="/topup" component={TopUp} />
          <ProtectedRoute path="/user" component={UserInfo} />
          <ProtectedRoute path="/edit-password" component={EditPassword} />
          <ProtectedRoute path="/delete-user" component={DeleteUser} />
          <ProtectedRoute path="/edit-transaction/:transactionId" component={EditTransaction} />
          <ProtectedRoute path="/delete-transaction/:transactionId" component={DeleteTransaction} />
          <ProtectedRoute path="/transaction-history" component={TransactionHistory} />
          <Route path="/" component={Login} />
        </Switch>
      </Router>
    </AuthProvider>
  );
}

export default App;
